import React from 'react';
import '../styles/main_form.css';

const Form = () => {
    return (
        <div>
            <h1>main form details</h1>
            <li class="color-theme">
                <ul id="1">cool blue</ul>
                <ul>light greyish</ul>
                <ul>macadamia</ul>
                <ul>redwood</ul>
                <ul>burnt under</ul>
            </li>
        </div>
    )
}

export default Form;
